class LinkedListNode
  attr_accessor :val, :next
  def initialize(node_value)
    @val = node_value
    @next = nil
  end
end

def create_linked_list(vals)
  head = LinkedListNode.new(vals.shift)
  start = head
  while (!vals.empty?) do
    start.next = LinkedListNode.new(vals.shift)
    start = start.next
  end
  head
end

def remove_duplicates(node)
  hash = {}
  prev = node
  hash[node.val.to_s] = 1
  start = node.next
  while (start.next) do
    if hash[start.val.to_s].nil?
      hash[start.val.to_s] = 1
      prev = start
      start = start.next
    else
      prev.next = start.next
      start = start.next
    end
  end
  print(node)
end

def print(pList)
  result = []
  result << pList.val
  while (!pList.next.nil? && pList = pList.next) do
    result << pList.val
  end
  result
end
